import { securitiesLowRisk } from "./data";
import useExchange from "./useExchange";

const SecuritiesLowRiskExchange = () => {
  const rates = useExchange();
  const securitieslowRiskAmount = (1 / rates.EUR) * securitiesLowRisk.amount;
  return securitieslowRiskAmount;
};

export default SecuritiesLowRiskExchange;
